import React from 'react';

const Resumen = ({datos}) => {
    
    //extraer datos
    const {marca, year, plan} = datos;

    //verifico antes de mostrar el resumen
    if(marca === '' || year === '' || plan === '') return null;

    return ( 
        <h2>Resumen de cotizacion</h2>
     );
}
 

export default Resumen;
